package com.davidlj95.leetcode;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.FieldSource;

import static org.junit.jupiter.api.Assertions.assertEquals;

class Dota2SenateTest {
    static final TestCase[] TEST_CASE = {
            new TestCase("RD", "Radiant"),
            new TestCase("RDD", "Dire"),
            new TestCase("D", "Dire"),
            new TestCase("DDRRR", "Dire"),
            new TestCase("RRR", "Radiant"),
            new TestCase("", "Radiant")
    };

    @ParameterizedTest
    @FieldSource("TEST_CASE")
    void doubleQueue(TestCase testCase) {
        assertEquals(testCase.expected, Dota2Senate.doubleQueue(testCase.senate));
    }

    record TestCase(String senate, String expected) {
    }

}